import React, {useState}  from 'react';

const HomePage = ({ onLogout }) => {
  const handleLogout = () => {
    // Perform logout logic here (e.g., clearing session)
    // Redirect to login page after logout
    window.location.href = '/login'; // You can use react-router for better navigation
  };

  return (
    <div>
      <header>
        <h1>Welcome to Home Page</h1>
        <button onClick={handleLogout}>Logout</button>
      </header>
      <div style={{ display: 'flex' }}>
        <nav style={{ width: '200px', backgroundColor: '#f0f0f0' }}>
          <h2>Navigation</h2>
          <ul>
            <li>User Management</li>
          </ul>
        </nav>
        <div style={{ flex: '1', padding: '20px' }}>
          <h2>Content</h2>
          <p>This is the content of the Home page.</p>
          <p>You can display any message or content here.</p>
        </div>
      </div>
    </div>
  );
};

export default HomePage;
